scriptlet.script:
lockoutTime = scriptletContext.get("lockoutTime");

if ((lockoutTime == 0) || ( lockoutTime == null))
{
        scriptletResponse = "failure";
        scriptletContext.put("returnCode", "1");
}

if (scriptletResponse == "success")
    scriptletContext.put("message", "Account is locked");
else
    scriptletContext.put("message", "Account is not locked")

if (scriptletResponse == "success")
    scriptletContext.put("message", "Account is locked");
else
    scriptletContext.put("message", "Account is not locked")
